const db = firebase.firestore();

// scrap "data:image/png;base64, " from blob
async function upload_image (base64_blob) {
  var storageRef = firebase.storage().ref('/trash_spots');
  let myuuid = uuidv4();
  var filename = myuuid + '.jpg'
  var fileRef = storageRef.child(filename);

  var res = await fileRef.putString(base64_blob, 'base64', {contentType: 'image/jpg'})
  var downloadURL = await res.ref.getDownloadURL()

  return downloadURL
}


async function upload_blobs (blobs) {
  var img_urls = []
  await Promise.all(blobs.map(async (blob) => {
    var img_url = await upload_image(blob)
    img_urls.push(img_url)
  }));

  return img_urls
}


async function add_pin(trashObject) {
  var img_urls = await upload_blobs(trashObject.blobs)

  db.collection("trash_spots").add({
    timestamp: firebase.firestore.FieldValue.serverTimestamp(),
    // latlang: new firebase.firestore.GeoPoint(trashObject.latlng.latitude, trashObject.latlng.longitude),
    lat: trashObject.latlng.latitude,
    lang: trashObject.latlng.longitude,
    image_urls: img_urls,
    description: trashObject.description,
    title: trashObject.title,
    cleaned: false
  })
  .then((docRef) => {
      console.log("Document written with ID: ", docRef.id);
  })
  .catch((error) => {
      console.error("Error adding document: ", error);
  });


}

